<span class="line"><span>        &quot;text&quot; : &quot;**Q** Where is TechShop located?\\n&lt;br&gt;**A** We have shops nationwide. See the Locations page for information and directions to all of our TechShop locations.\\n\\n**Q** What are TechShop&#39;s operating hours?\\n&lt;br&gt;**A** TechShop is open 9AM to midnight every day except holidays. See the Locations page and select your location for specific operating hours and holiday schedule.\\n\\n\\n**Q** Can you show me how to use the tools and equipment?\\n&lt;br&gt;**A** Yes! We offer Safety and Basic Use (SBU) classes to get you up to speed quickly and safely.\\n\\n\\n**Q** What type of classes does TechShop offer?\\n&lt;br&gt;**A** We offer several types of classes:\\n- Safety and Basic Use (SBU) classes are designed to provide you with basic safety training on a specific tool or machine.\\n- Pathway classes are offered as building blocks to help you meet your project goals.\\n- Project classes offer instruction in the specific techniques necessary to complete an in-class project.\\n\\n\\n**Q** Do I have to be a member to take classes?\\n&lt;br&gt;**A** No! Anyone can take classes at TechShop. (For safety reasons, some classes have minimum-age requirements.) Taking a class is a great way for you to pick up new skills and experience the many ways in which a TechShopmembership can empower you first hand.\\n\\n\\n**Q** What tools and equipment does TechShop provide its members?\\n&lt;br&gt;**A** We provide our members access to just about every machine, tool and process that you can imagine, including milling machines and lathes, Epilog laser cutters, sheet metal equipment, welding equipment, an indoor automotive work bay, woodworking equipment including a 4&#39; x 8&#39; CNC ShopBot router, plastics working equipment, hand tools, a 3D printer, computer-controlled vinyl cutter, sewing machines, design software and lots more.\\n\\n\\n**Q** Can I use any tool or machine in the shop?\\n&lt;br&gt;**A** Yes, as soon as you have taken and passed the Safety and Basic Use (SBU) class for that tool or machine, if one is required.\\nA good number of the tools and some of the machines at TechShop DO NOT have an SBU. However, for safety reasons, if a machine can injure you or can be damaged through improper use, then you must first take and pass the related safety and basic use class.\\n\\n\\n**Q** Can I reserve time on a machine?\\n&lt;br&gt;**A** Yes! With an active TechShop membership, you can reserve time on any machine in advance of your visit by calling the TechShop front desk.\\n\\n\\n**Q** How much does a TechShop membership cost?\\n&lt;br&gt;**A** For current TechShop membership pricing and offers, see the Membership page. Your TechShop membership is good at all TechShop locations nationwide.\\n\\n\\n**Q** How do I cancel or get a refund for a TechShop membership or class?\\n&lt;br&gt;**A** See the Refund and Cancellation Policy page for complete details.\\n\\n\\n**Q** Can my kids work on projects and take classes with me at TechShop?\\n&lt;br&gt;**A**See here for our complete family policies.\\nKids and young adults (12 to 17 years of age) can work on projects at TechShop under the direct supervision of a parent or legal guardian if they are included in your membership (call and ask about our Family Membership offers).\\nMany classes at TechShop are open to kids and young adults (12 to 17 years of age) when they are taken with their parent or legal guardian. However, based on the inherent risk to the operator there are some tools and machines atTechShop that kids are not permitted to operate at any time. These include the milling machines and lathes.\\nChildren under 12 years of age are not permitted to enter the workshop areas at TechShop except for during staff guided tours, age-appropriate classes and certain special events.\\n\\n\\n**Q** How long has TechShop been open?\\nA TechShop opened on October 1, 2006.\\n\\n\\n**Q** Does TechShop carry liability insurance?\\n&lt;br&gt;**A** Of course. We have liability insurance and we require members and anyone who takes a class at TechShop to sign a liability release waiver. We also require members to receive safety training on machines and equipment before they can use it. We don&#39;t want anyone to experience an injury. We always strive to build a safety-conscious culture atTechShop.\\n\\n\\n**Q** Can I open a TechShop in my area?\\n&lt;br&gt;**A** We are expanding TechShop to other cities as company-owned locations and are not currently offering franchise opportunities. We will announce on our web site if we choose to offer franchises in the future.&quot;,</span></span>
