<span class="line"><span>        &quot;text&quot; : &quot;###Individual Membership - 1 Month\\n\\nUnlimited access to TechShop facilities. Use our advanced machines and tools, sophisticated design workstations and software, network with other members, and work on your projects. Includes all member perks.\\nPrice: **$175.00**\\n\\n###Individual Membership - Monthly Recurring\\n\\nSave $50 a month. Membership is automatically renewed monthly via credit card – just call when you would like to cancel. Includes all member perks.\\nPrice: **$125.00**\\n\\n###Individual Membership - 1 Year\\n\\nSave over $700 off regular month-by-month membership pricing. Unlimited access to TechShop facilities. Use our advanced machines and tools, sophisticated design workstations and software, network with other members, and work on your projects. Includes all member perks.\\nPrice: **$1,395.00**\\n \\n#### + Family Add-On Memberships ($500.00 yearly)\\n#### + Students &amp; Active Duty Military ($995.00 yearly)&quot;,</span></span>
