<span class="line"><span>        &quot;text&quot; : &quot;- Ручной электроинструмент: дрели, шуруповерты, шлифовальные машинки (ленточные и вибрационные), электролобзики, ручные фрезеры, присадочный фрезер, перфоратор, болгарки(УШМ).\\n- Заточной станок \\n- Торцовочная пила Энкор-корвет 4-430 \\n- Циркулярный станок EINHELL\\n- Лобзиковый станок JET JSS16\\n- Рейсмусовый станок JET JWP12\\n- Шлифовальный станок JET JSG64\\n- Токарный станок Корвет 73\\n- Муфельная печь для обжига керамики.\\n- Швейные машинки, утюги,гладильная доска.\\n- Набор инструментов для ювелирных работ: верстак, тиски, фенагели, лобзики, горелка, бормашина, надфели, кусачки, расходные материалы (шлифшкурка, кислота, проволока, припой и т.д.).&quot;,</span></span>
