<span class="line"><span>        &quot;text&quot; : &quot;*Друзья, в мастерской Класс Труда вы можете:*\\n\\n\\n###Приобрести абонемент и работать в мастерской:\\n\\nАбонемент на **1 день**. Возможность использовать все оборудование и инструменты мастерской с 12 до 23 часов.&lt;br&gt; Стоимость **700 рублей**.\\n\\n\\nАбонемент на 10, 20 и 30 часов. Действует в течение 3 месяцев со дня покупки, возможно использовать абонемент одновременно для нескольких человек. По этому абонементу доступно все оборудование мастерской ежедневно с 12 до 23. &lt;br&gt;\\n- 10 часов **1500 рублей** (150 рублей/час);\\n- 20 часов **2400 рублей** (120 рублей/час);\\n- 30 часов **3000 рублей** (100 рублей/час);\\n\\n\\nАбонемент на 1 месяц с возможностью хранения инструментов/материалов и индивидуальным рабочим местом. &lt;br&gt;\\nСтоимость абонементов **6000 рублей/в месяц**.\\n\\n\\n###Записаться на один из курсов или мастер-классов, проводимых в мастерской Класс Труда:\\n\\n- Дизайн и изготовление ювелирных изделий \\n- Курс по работе с деревом: делаем декоративную ширму, барный стул и дизайнерский светильник \\n- Еженедельные мастер-классы по керамике \\n- Еженедельные мастер-классы резьбы по дереву \\n- Детский день \\nСписок курсов, мастер-классов и событий постоянно меняется, удобнее следить за актуальным расписанием.\\n\\n###Посетить индивидуальное занятие с мастерами.\\n\\nКласс Труда объединяет много талантливых мастеров. Индивидуальные занятия с мастерами способствуют не только получению новых знаний и навыков, но и помогают отдохнуть от офисных будней в творческой атмосфере.&lt;br&gt;\\nСтоимость: от 1500 рублей за занятие\\n\\n###Провести мастер-класс. \\n\\nК вашим услугам большие столы 1.5х1.5 метра для компании 8-10 человек, чай-кофе-печеньки. Мы сделаем анонсы вашего мероприятия в группе Класса Труда и проведем небольшую фотосъемку.\\nСтоимость аренды места для проведения мастер-класса \\n**300 руб./час** в будни до 17:00\\n**400 руб./час** в будни вечером и в выходные/праздничные дни\\nЕсли вы талантливый мастер, мы готовы рассмотреть индивидуальную работу с вами, организацию курсов и тп. \\n\\n###Заказать нам изготовление изделий из дерева, металла и тп.\\nЕсли вы хотите сделать что-то оригинальное, у вас есть идея и желание ее воплотить, но нет времени или навыка сделать это самостоятельно, то мы можем вам помочь. Спроектируем, рассчитаем стоимость, посоветуем оптимальный вариант.\\n\\n###Арендовать мастерскую под частное мероприятие (до 50 человек).\\nВы можете арендовать всю мастерскую или один из 3х залов ( 85, 70 и 25 метров) для проведения корпоративного мероприятия, дня рождения, закрытого мастер-класса и тп. Мы можем организовать для вас мастер-классы по различным направлениям с опытными мастерами. Работаем как с физическими, так и с юридическими лицами.\\n\\n###Арендовать мастерскую под массовое мероприятие.\\nМастерская находится в пешей доступности от м. Петроградская (5 минут). Вы можете арендовать всю мастерскую или один из 3х залов ( 85, 70 и 25 метров). Мы заинтересованы в проведении мероприятий на нашей площадке и всегда поддержим интересную идею и новое начинание. \\n\\n###Провести фото и видео съемку, свадебные сборы, и тп.&quot;,</span></span>
