<span class="line"><span>        &quot;text&quot; : &quot;**г. Москва**\\n\\nметро Чистые пруды\\nМилютинский пер. 19/4 стр. 2\\n+7 968 964 2506\\n\\n\\nhttp://www.trudodvor.ru\\n\\n«Двор Сотрудней» – это одновременно и ремесленный коворкинг, и пространство для передачи опыта и знаний мастерам всех возрастов, и столярный цех, выполняющий как собственные проекты, так и изготавливающий деревянные изделия различного назначения, размеров и степени сложности на заказ.\\n\\nМы создали для тебя удобное и функциональное пространство для творчества&quot;,</span></span>
