<span class="line"><span>        &quot;text&quot; : &quot;Вид работы:\\tПочасовая оплата\\tАбонемент\\n1200 руб\\tМесячная оплата\\n6000 руб\\n\\nТолько ручным инструментом\\t200 р\\t150 р/час\\tбез ограничения\\n\\n\\nС электроинструментом\\t220 р\\t170 р/час\\tбез ограничения\\n\\n\\nРабота на станках\\t250 р\\t200 р/час\\tбез ограничения\\n\\n\\nЕсли вы собираетесь впервые воспользоваться нашими станками, и у вас нет необходимого опыта работы на них, наши мастера проведут для вас обязательный ознакомительный курс, включающий правила техники безопасности.\\n\\nКурс-обучение по работе с оборудованием:\\tСтоимость\\tПродолжительность курса\\n\\n- Цирулярная пила\\t500 р\\t40 мин\\n- Ленточная пила\\t400 р\\t30 мин\\n- Фрезер\\t500 р\\t40 мин\\n- Торцовочная пила\\t300 р\\t20 мин\\n- Рейсмус\\t300 р\\t20 мин\\n- Фуганок\\t300 р\\t20 мин\\n- Сверлильный станок\\t300 р\\t20 мин\\n- Полный курс обучения (Вы экономите 600р)\\t2000 р\\t2.5 — 3 часа&quot;,</span></span>
