<span class="line"><span>        &quot;text&quot; : &quot;Система **OOLEY** — это как рецепт для создания, использования, поддержания и развития устойчивых открытых мастерских. Как и любой рецепт, его сначала нужно изобрести, чтобы потом попробовать, описать и делиться им. **Изобретаем!**\\n\\nКоллективная разработка и тестирование принципов работы  и оформления устойчивых открытых мастерских. Блог об экспериментах и обобщение опыта.&quot;,</span></span>
