<span class="line"><span>        &quot;text&quot; : &quot;Современные веб-сайты представляют множество вариантов организации потоков информации, в том числе и платежной. Статические сайты, социальные сети, блоги, форумы, и множество различных менее обобщаемых форматов, все это позволяет направлять бесчисленные потоки информации. Социальные сети доказали свою эргономичность для общества в процессе быстрого и глубокого проникновения их в социальное взаимодействие. Возможности создания виртуальных представительств групп людей или событий чрезвычайно расширяют возможности влияния соц. сетей на происходящее в офф-лайн. Наблюдается и обратная тенденция с растворением в виртуальном пространстве множества видов деятельности еще недавно не требовавших даже наличия компьютера. \\n\\nВозникшая и стремительно развивающаяся сфера интернет-торговли обнаруживает уже куда большее влияние на окружающий мир, хоть и по старым правилам. Новые правила направления движения средств, продукции и человеческих ресурсов внесли в общество различные краудфандинговые и краудсорсинговые площадки.\\n\\nВ результате наблюдения за ними все более очевидными становятся преимущества организации социального взаимодействия на основании правильно сформулированных проектов. Понятие правильного проекта меняется площадки к площадке, но каркас его остается в основном одним. Для успешной реализации любого проекта нужно определиться с его названием, коротким, но емким описанием, датами начала и окончания той или иной деятельности в рамках проекта, описания необходимых для реализации средств, а также списка подарков, которые может получить каждый, кто совершит определенный вклад в этот проект. \\n\\nТаким образом и возникает идея о возможности построения принципиально нового способа конструктивного общественного взаимодействия посредством сети, направленного на открытую совместную разработку и реализацию различных проектов. Используя продуманную созидательно-направленную систему взаимодействия лиц, возможно максимизировать конструктивность человеческого взаимодействия в сети. \\n\\nТо есть идея заключается в создании модульного веб-приложения, которое будет позволять своим пользователям проявлять максимум своих офф-лайн возможностей, отходить или откладывать в сторону экраны и что-то делать по-настоящему. Учитывая важность прозрачности вложения и направления средств и усилий, необходимо обеспечить возможности коллективной оценки затей, а также сбора и направления средств на их реализацию.\\n\\nВ настоящее время многочисленные исследования в области UX показывают удобство и психологическую эргономичность интерфейсов построенных на использовании модульной системы виртуальных карточек, содержащих ту или иную информацию, а также наглядной и конструктивной системы организации их взаимосвязей.\\n\\nПосле примерной разработки *схем взаимодействия лиц и элементов интерфейса*&amp;sup1;, а также способов *структурирования и хранения данных*&amp;sup2;, была начата разработка интерактивного прототипа, позволяющего наглядно представить модель \\&quot;электронной картотеки\\&quot; с широкими возможностями поиска, сбора и коллективного структурирования информации.\\n\\nНа момент начала 2014 года наиболее подходящей для прототипирования интерфейса средой был выбран фреймворк **AngularJS**. Для хранения и реактивной синхронизации данных на период тестирования используется SaaS база данных **Firebase** с адаптером AngularFire. Такое архитектурное предполагает существенные ограничения в объеме хранимых и обрабатываемых данных и в количестве одновременно подключенных пользователей (в бесплатной версии Firebase — не более 50 человек), однако позволяет тестировать конструктивные решения Лент вживую и быстро вносить соответсвующие коррективы. \\n\\nИспользуя данные тестирования можно прояснить множество важных черт будущей более основательной версии Лент, осознать требования к архитектуре и технологическому наполнению приложения. Совместная доработка прототипа поможет найти взаимопонимание между заинтересованными в развитии системы разработчиками. \\n\\nРазработка прозрачной системы сбора даров и направления их на реализацию затей позволит обеспечить проекты необходимыми средствами. Прозрачная система отчетности о расходовании средств участниками реализации проектов обеспечит устойчивость системы к недобросовестности отдельных лиц.\\n\\nТаким образом Ленты — важная часть большого и сложного организма Фонда ФРУКТ, потенциально позволяющая осуществлять все его объявленные возможности в сетевом пространстве. \\n\\nКонструктивное общение в Лентах позволяет высвободить творческий человеческий потенциал.\\n====\\n\\n----\\n\\n&amp;sup1; Для обеспечения конструктивности потока высказываний используется структура Затей (объектов, событий и пр.), разрабатываемая в **[Дискурсе](http://feeds.frkt.ru/#C)**.\\n\\n&amp;sup2; Для удобной системы адресации и индивидуализации высказываний используется система счета и учета **[АВЕКМНОРСТУХ](http://feeds.frkt.ru/#B)**.&quot;,</span></span>
