<span class="line"><span>        &quot;text&quot; : &quot;МАНИФЕСТ\\n=======\\n\\nOOLEY — это сеть публикации и среда распространения различных навыков и умений, а также центр изучения принципов организации, разработки моделей и полномасштабной реализации разнообразных устойчивых открытых мастерских.\\n\\nВ конце века всеобщей веры в бесконечное экономическое развитие через развитие рынка, в особенности финансового, особенно ярко проявляются последствия фокусировки общества на узкой специализации, высокой конкуренции и чрезмерном потреблении как на основных ориентирах и идеалах для каждого из его членов. Поиск противовесов для этих нарушений общественного равновесия приводит к необходимости разработки и создания культурной среды и всевозможной инфраструктуры для широкого обмена и распространения навыков и умений, создания условий для взаимовыгодной кооперации, а также содействия творческой реализации для максимально широкого круга лиц.\\n\\n&gt; Навык — доведенное до автоматизма умение реализовывать известные задачи или получать творческие результаты с применением соответствующего инструмента и материалов, а также руководство по овладению им.\\n\\nДля каждого, кто долгое время занимается только узко специализированной деятельностью, очень важно находить возможности получать различные новые навыки и умения для осознания и поддержания своей независимости от конкретного работодателя или специальности. Уверенность в собственных силах приходит только с практикой. Но в том случае, если человек оказывается уверен только в определенных рамках своей специальности и нередко оказывается в растерянности, сталкиваясь с ситуациями, требующих более широкого круга как теоретического, так и практического опыта, очевидна необходимость в расширении кругозора и получении и реализации новых навыков и умений в иных сферах деятельности.\\n\\nOOLEY стремится обеспечить максимально доступную среду для выработки, сохранения и совершенствования широкого спектра навыков и умений. Предоставляя возможности для публикации, обмена и распространения навыков, а также информации о существующих мастерских и их возможностях, умельцах и умелицах, инструментах и материалах, событиях и творческих результатах, OOLEY способствует развитию и поддержанию особой творческой культурной среды в информационном пространстве.\\n\\n&gt;Умение — интеллектуально контролируемая деятельность, включающую координацию различных навыков и осознанных действий позволяющими надежно получать качественный результат даже в меняющихся условиях.\\n\\nУмения сочетают  осознанную  целенаправленную деятельность  и  координацию имеющихся навыков, именно поэтому с ростом количества различных навыков, количество и качество умений может расти пропорционально росту количества всевозможных комбинаций.\\n\\nНесмотря на огромные возможности компьютерных сетей по обмену знаниями, далеко не все знания можно постичь только с помощью восприятия её с помощью экранов. А существующие мастерские  и модели их функционирования не могут обеспечить достаточного пространства и открытости для широкого обмена навыками, инструментами, материалами и результатами труда.\\n\\nИменно поэтому OOLEY ставит себе задачу разработки и тестирования моделей, а также полномасштабной реализации разнообразных устойчивых открытых мастерских.\\n\\nНавыки и умения по-настоящему проявляются только при наличии необходимого и достаточного инструмента и материала, а также при наличии подходящей компании умельцев и соответствующих полезных площадей. Максимальная универсальность и гибкость мастерской необходимы для увеличения количества возможных к реализации навыков и умений, а также умельцев и умелиц, ими обладающих.\\n\\nТакже как взаимодействие различных навыков порождает бесчисленные варианты умений, взаимодействие людей, обладающих различными навыками и умениями порождает бесчисленные варианты кооперации, благодаря которой возможно достижение все более сложных и масштабных результатов. Создавая условия для снижения конкуренции и способствуя кооперации между людьми, компаниями и сообществами, OOLEY развивает все более эффективные формы взаимодействия между ними.\\n\\nОткрытость мастерской подразумевает возможность доступа наиболее широкого круга заинтересованных лиц, с учетом  ограничения на использование инструментов без соответствующих навыков, но с предоставлением возможности их получить или доказать.\\n\\nУстойчивость мастерской означает предсказуемость  и эффективность модели её управления, финансирования, наполнения инструментами и материалами, распоряжения полученными результатами, выработки и распространения умений и навыков, а также гибкость во взаимодействии с различными территориями, культурами, возможностями населения и темпами эволюции технологии.\\n\\nВ условиях ясно наметившегося «кризиса перепроизводства», когда спрос на потребление товаров и услуг оказывается насыщенным и стремится к снижению, наиболее остро встает вопрос о замещении потребления в сфере ценностей и практической деятельности каждого члена общества. OOLEY предлагает обратить внимание на малоисследованные и потенциально неисчерпаемые возможности индивидуального и коллективного творчества и различной созидательной деятельности. Добровольная совместная производственная деятельность в условиях широкого распространения и развития различных навыков и умений, прозрачной системы доступа к инструментам и материалам, а также свободного распоряжения её результатами, — потенциально надежное  и работоспособное решение множества экономических проблем, возникших в результате чрезмерной концентрации на рыночно-капиталистической форме воспроизводства.\\n\\nOOLEY — это не готовое решение, это площадка для полномасштабной дискуссии, планирования и проведения исследований и экспериментов с публикацией их результатов, поиска и проработки возможностей воплощения различных форм и моделей реализации мастерских, а также полномасштабной совместной реализации различных открытых мастерских и объединения их в сети.&quot;,</span></span>
