<span class="line"><span>        &quot;text&quot; : &quot;Очевидно, что упаковки навыков и умений в мультимедиа-форму еще не достаточно для того, чтобы это принесло какую-то существенную новизну и пользу. Классам нужна классификация. Можно попробовать разработать свой классификатор или воспользоваться наработками существующих.\\nВ России есть **ОКВЭД**, на международном уровне есть **ISIC**.\\n\\nМожно использовать эти наработки и продумать структуру курсов — классов — умений — навыков.&quot;,</span></span>
